import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  let [data, dataSet] = useState([
    {title: '제목'},
    {article: '게시내용'},
    {dateTime: '2020/12/25 00:00:00'}
  ]);

  return (
    <div className="App">
      <div className="header-nav">
        <div>Playneko의 블로그</div>
      </div>
      <div className="lists">
        <h3>{ data.title }</h3>
        <p>{ data.dateTime }</p>
        <p>{ data.article }</p>
        <hr />
      </div>
    </div>
  );
}

export default App;
